"original": |2-
     The IANA policy (using terms defined in [RFC5226]) for type1 keyword
     extensions is Specification Required.  The IANA policy for type2
     keyword extensions is Expert Review.  The IANA policy for vendor
     keyword extensions is First Come First Served.  Only attributes using
     the type1 and type2 keyword syntax can be registered in the IANA IPP
     registry.
"fixed": |-
  The IANA policy (using terms defined in [RFC5226]) for type1 keyword extensions is Specification Required.  The IANA policy for type2 keyword extensions is Expert Review.  The IANA policy for vendor keyword extensions is First Come First Served.  Only attributes using the type1 and type2 keyword syntax can be registered in the IANA IPP registry.
"ko": |-
  type1 키워드 확장에 대한 IANA 정책([RFC5226]에 정의된 용어 사용)은 사양 필수입니다. type2 키워드 확장에 대한 IANA 정책은 전문가 검토입니다. 공급업체 키워드 확장에 대한 IANA 정책은 선착순입니다. type1 및 type2 키워드 구문을 사용하는 속성만 IANA IPP 레지스트리에 등록할 수 있습니다.
